import logo from "./logo.svg";
import "./App.css";
import Card from "./component/Card";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      ColorPalettes: []
    };
  }

  componentDidMount() {
    fetch(
      "https://v2-api.sheety.co/69072a59b5982e9dd27aaa5bf290e8c6/colorsnt/data/3"
    )
      .then(response => response.json())
      .then(data => {
        this.setState({
          ColorPalettes: data.datum
        });
      });
  }

  render() {
    const AllCards = productsData.map(item => (
      <Card
        name={this.state.ColorPalettes.name}
        firstColor={this.state.ColorPalettes.firstColor}
      />
    ));

